 	var resURL = "\&" + resultantURL.toLowerCase();
 	var query = resURL.split('\&s=')[1].split('\&')[0].split("%20").join(" ").split("+").join(" ");
 	mainProcess(query);
 }

 function setURL(q) {
 	window.location.href = '\?' + UrlSearchQ + q;
 }
	</script>
